import { Box } from '@mui/material'
import React from 'react'
import SearchIcon from '@mui/icons-material/Search';
import { InputBase } from '@mui/material';

export const Search = () => {
  return (
    <Box>
        <Box>
            <Box>
                <SearchIcon/>
            </Box>
            <InputBase/>
        </Box>
    </Box>
  )
}
